      window.reportProps["appData"] = { data: { result: {"view_xml": "\u003cView version=\"1\" fragment=\"false\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"Landing Page\" columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[# Peloton\n\nCycling pelotons work together to achieve things no rider can do alone. They\nshare workload, support each other, and prioritise when/where to spend their\nenergy. All this while constantly moving forward. Let\u0027s channel that spirit to\nkeep our open source projects at race-fitness!\n\nEach of the tabs here are focussed on something key to project health. They\ninclude various ideas for issues/PR\u0027s to focus on. Try to split meeting time\n~equally between each of the tabs, and see how far you get \ud83d\ude42 .\n\nThe pages and views shown here are very much open to improvement.\n[See Bitbucket](https://bitbucket.org/metoffice/codeshares/src/master/peloton/)]]\u003e\u003c/Text\u003e\u003cMedia type=\"image/jpeg\" src=\"ref://345b4908b7\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Ownership\" columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[# Ownership\n\n### Reviewing the progress of _assigned_ issues/PR\u0027s\n\nDon\u0027t be afraid to un-assign, when appropriate.]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.vegalite.v4+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://1c0eccf1f7\"/\u003e\u003cSelect type=\"tabs\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Stalest comments\" src=\"ref://083ad47676\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Freshest comments\" src=\"ref://9dc6866156\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Most assigned\" src=\"ref://4558f95ece\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Most comments\" src=\"ref://7d07c03b91\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"Most votes\" src=\"ref://108d8dc61f\"/
